export default function Terms() { // COMPONENT TO READ THE TERMS OF SERVICE
  const leerArchivo = () => {
    const reader = new FileReader(); // Use FileReader object
    reader.readAsText('../../public/terms.txt');
  }
  return (
    <>
      <div>{leerArchivo()}</div>
    </>
  );
}
